import React from 'react';




function SignBridge() {
  return (
    <section classname="signbridge">
    <div classname="first">
      <p>Sign Bridge is a user-friendly React.js based web application that's all about making American Sign Language (ASL) easy and fun to learn, while also offering a handy translation feature. <br />
        We designed it with a big goal in mind: to shatter language barriers and create a stronger, more inclusive bond between the deaf and hearing communities.</p>
    </div>
    </section>
  );
}

export default SignBridge;
